import React from 'react';
import './courses.css'
import { NavLink } from 'react-router-dom';

import Card from '../../Components/Card/card'

const Courses = ( {courses} ) => {

    const cardsList = courses?.map((card, index) => (
        <Card
            image={card.image}
            type={card.type}
            course={card.course}
            class={card.class}
            key={index}
         />
     ))

    return (
        <div className="courses-container">
            <h1 className="courses-my">Meus Cursos</h1>
            <NavLink exact to={`/courses/${courses.id}`} className="courses-course_button" activeClassName="courses-course_button_active" >
                <div className="courses-cards" courses={courses}>{cardsList}</div>
            </NavLink>
        </div>
    )



};

export default Courses;
